    d = [0] * n
    c = [0] * n
    for i in range(n):
        d[i] = s[i]
        c[i] = 1
    for i in range(n - 1):
        for j in range(i + 1, n):
            if s[i] < s[j]:
                d[j] = max(d[j], d[i] + 1)
                c[j] += 1
    for i in range(n - 1):
        for j in range(i + 1, n):
            if s[i] < s[j]:
                c[j] += 1
    if c[n - 1] == 0:
        return '-1'
    else:
        return str(n - c[n - 1])

